import React from 'react';
import Header from './components/header.js'
import AboutMe from './components/aboutme.js'
import Skills from './components/skills.js'
import Footer from './components/footer.js'

const App = () => (
  <div>
    <div>
      <Header />
      <AboutMe />
      <Skills />
      <Footer />
    </div>

  </div>
);

export default App;
